CREATE TABLE `system_role` (
  `id` bigint(20) unsigned NOT NULL,
  `tenant_id` bigint(20) unsigned NOT NULL COMMENT '租户id',
  `tenant_name` varchar(20) NOT NULL COMMENT '租户名称',
  `tenant_type` int(10) unsigned NOT NULL COMMENT '租户类型：0=其它，1=控股企业，2=合作伙伴',
  `project_id` bigint(20) unsigned NOT NULL COMMENT '所属系统id',
  `project_name` varchar(30) NOT NULL COMMENT '所属系统名称',
  `name` varchar(30) NOT NULL COMMENT '系统角色名称',
  `pinyin` varchar(200) NOT NULL COMMENT '系统角色名称拼音',
  `short_pinyin` varchar(30) NOT NULL COMMENT '系统角色名称简拼',
  `permissions` varchar(5000) DEFAULT NULL COMMENT '功能权限字符串，e.g. home:C|R|U,user:R',
  `descp` varchar(200) DEFAULT NULL COMMENT '备注',
  `status` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '状态：0=不可用，1=正常',
  `modified_account` varchar(50) DEFAULT NULL COMMENT '最后修改人账户',
  `modified_name` varchar(50) DEFAULT NULL COMMENT '最后修改人名称',
  `create_time` datetime,
  `modified_time` datetime ,
  `access_type` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8

